import './App.css';
import Home from "../Home/Home";
import Navbar from "../Navbar/Navbar";
import React, {useEffect, useState} from 'react'

function App() {
  const [backendData, setBackendData] = useState ([{}]);

  useEffect(() => {
    fetch("/api")
    .then(response => response.json())
    .then(data => setBackendData(data))
  }, [])

  return (
      <body>
        <Navbar/>
        <Home/>
      </body>
  );
}

export default App;
